import React from "react";
import { Card } from 'react-bootstrap'
import classes from './ExpenseDetails.module.css'

const ExpenseDetails=  (props)=>{
    let content

        let errorMessage='Authentication Failed!'
        let data;
        fetch('https://react-http-333ab-default-rtdb.asia-southeast1.firebasedatabase.app/Expenses.json')
        .then(async (response)=>{
            
            if(response.ok){
            
                return response.json()
            }else{
                return response.json().then(data=>{
                    if(data && data.error && data.error.message){
                      errorMessage=data.error.message
                      throw new Error(errorMessage)
                }
            })}
        })
        .then((data)=>{
            console.log(data)
             const key=Object.keys(data)
             console.log(key)
            
            key.forEach((k)=>{
                console.log(data[k].category)
                content=<li>{data[k].category} <button>Delete</button></li>
                
            })
        }).catch((err)=>{alert(err.message)})
    
    return(
        <Card className={classes.users}>
        <ul>
            {content}
        </ul>
        </Card>
    )
}

export default ExpenseDetails
